const Comments = () => {
    const user1 = {
        name: '겨울이',
        img: 'https://assets.chatgpt4google.com/assets/promo/43.gif',
    }
    const user2 = {
        name: '가을이',
        img: 'https://ssl.pstatic.net/melona/libs/1490/1490429/9fabf99cb1318e674d83_20240318144413924.png',
    }
    const comment1 = {
        user: user1,
        text: '난 예민해. 아무거나 먹지 않아.',
        date: '2024.03.31',
    }
    const comment2 = {
        user: user2,
        text: '난 사료를 좋아해. 많이 많이 먹어.',
        date: '2024.05.05',
    }

    return (
        <div>
            <h2>Comments</h2>
            <Comment data={comment1} />
            <Comment data={comment2} />
        </div>
    )
}

const Comment = ({ data }) => {
    // data = { user: { name: '겨울이', img: 'https://assets.chatgpt4google.com/assets/promo/43.gif' }, text: '난 예민해. 아무거나 먹지 않아.', date: '2024.03.31' }
    return (
        <div>
            <User user={data.user} />
            <p>{data.text}</p>
            <time>{data.date}</time>
        </div>
    )
}

const User = () => {
    return (
        <div>
            <img src="https://assets.chatgpt4google.com/assets/promo/43.gif" alt="겨울이" />
            <p>겨울이</p>
        </div>
    )
}

export default Comments
